import FilterButton from "./FilterButton";

function FilterContainer() {
    const srcList =[
    "/images/전체.svg",
    "/images/브랜드.svg"
  ];

  const TextList = ["1", "2", "3", "4", "5"];
  const listItems = TextList.map((Text) =>
    <li key={Text.toString()}>
      {Text}
    </li>
  );
  return (
    <div>
    <ul className="Filter_container">
    {FilterButton(srcList[0],TextList.text[0])}
      <FilterButton/>
      <FilterButton/>
      <FilterButton/>
      <FilterButton/>
    </ul>
  </div>
);
}

export default FilterContainer;

